import React from 'react';
import './styles.css'

import Header from '../../components/Header'

export default function Home() {
  return (
    <div>
      <Header />
      <div className="container-home">
        <h3>
          Venha para uma experiência incrível: <br /> 
          O desbotado brilhando,<br />
          Raízes mais fortes,<br />
          Cabelo tudo OK!
        </h3>
      </div>
    </div>
  );
}
